import React, { useState } from 'react';

const QuadraticCalculator: React.FC = () => {
  const [coefficients, setCoefficients] = useState({ a: '', b: '', c: '' });
  const [result, setResult] = useState<{ x1: number | null; x2: number | null; discriminant: number } | null>(null);
  const [error, setError] = useState<string>('');

  const solveQuadratic = () => {
    const a = parseFloat(coefficients.a);
    const b = parseFloat(coefficients.b);
    const c = parseFloat(coefficients.c);
    if (isNaN(a) || isNaN(b) || isNaN(c)) {
      setError('Please enter valid numbers for all coefficients');
      return;
    }
    if (a === 0) {
      setError('Coefficient "a" cannot be zero as this would not be a quadratic equation');
      return;
    }
    const discriminant = b * b - 4 * a * c;
    let x1: number | null = null;
    let x2: number | null = null;
    if (discriminant > 0) {
      x1 = (-b + Math.sqrt(discriminant)) / (2 * a);
      x2 = (-b - Math.sqrt(discriminant)) / (2 * a);
    } else if (discriminant === 0) {
      x1 = x2 = -b / (2 * a);
    }
    setResult({ x1, x2, discriminant });
    setError('');
  };

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setCoefficients(prev => ({ ...prev, [name]: value }));
  };

  const getResultText = () => {
    if (!result) return '';
    if (result.discriminant < 0) {
      return 'This equation has no real solutions (complex roots)';
    } else if (result.discriminant === 0) {
      return `This equation has one repeated solution: x = ${result.x1?.toFixed(4)}`;
    } else {
      return `Solutions: x₁ = ${result.x1?.toFixed(4)}, x₂ = ${result.x2?.toFixed(4)}`;
    }
  };

  return (
    <div className="w-full max-w-md mx-auto bg-white/10 backdrop-blur-lg rounded-3xl shadow-2xl p-8 border border-gray-200/20 animate-fade-in">
      <h2 className="text-3xl font-bold text-center text-white mb-2">Quadratic Equation Solver</h2>
      <p className="text-center text-gray-300 mb-2">Solves equations in the form: <span className="font-mono">ax² + bx + c = 0</span></p>
      <div className="flex justify-center mb-4">
        <span className="text-sm font-mono bg-gray-800/60 text-gray-200 rounded px-2 py-1">x = (-b ± √(b² - 4ac)) / 2a</span>
      </div>
      <form className="flex flex-col gap-4">
        <div className="flex gap-2">
          <input
            className="flex-1 rounded-lg px-3 py-2 bg-gray-900/60 text-white border border-gray-600 focus:outline-none focus:ring-2 focus:ring-blue-400 placeholder-gray-400"
            placeholder="a"
            name="a"
            value={coefficients.a}
            onChange={handleInputChange}
            type="number"
            required
          />
          <input
            className="flex-1 rounded-lg px-3 py-2 bg-gray-900/60 text-white border border-gray-600 focus:outline-none focus:ring-2 focus:ring-blue-400 placeholder-gray-400"
            placeholder="b"
            name="b"
            value={coefficients.b}
            onChange={handleInputChange}
            type="number"
            required
          />
          <input
            className="flex-1 rounded-lg px-3 py-2 bg-gray-900/60 text-white border border-gray-600 focus:outline-none focus:ring-2 focus:ring-blue-400 placeholder-gray-400"
            placeholder="c"
            name="c"
            value={coefficients.c}
            onChange={handleInputChange}
            type="number"
            required
          />
        </div>
        <button
          type="button"
          className="w-full py-2 rounded-lg bg-gradient-to-r from-blue-500 to-indigo-500 text-white font-semibold shadow hover:scale-105 transition-transform"
          onClick={solveQuadratic}
        >
          Solve
        </button>
      </form>
      {error && <div className="text-red-400 text-center mt-2">{error}</div>}
      {result && (
        <div className="mt-4 text-center">
          <div className="text-lg text-white font-semibold mb-1">Result</div>
          <div className="text-gray-200">{getResultText()}</div>
          <div className="text-xs text-gray-400 mt-1">Discriminant: {result.discriminant}</div>
        </div>
      )}
    </div>
  );
};

export default QuadraticCalculator;
